import React from 'react';
import {BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './containers/Home';

const Router = () => {
    return (
        <>
        <BrowserRouter>
            <Routes>
                <Route exact path={'/'} element={<Home />} />
            </Routes>
        </BrowserRouter>

        </>
    );
};
export default Router;
